Creating a smooth snake game in C with image animation (considering typical constraints without heavy GUI libraries) can be achieved with a combination of SDL (Simple DirectMedia Layer) or custom double-buffering techniques, since pure C without external graphics libraries is limited. Here's a structured approach using SDL2, which is a common choice for such tasks:

**1. Set Up SDL2 Environment**

First, ensure you have SDL2 installed on your system. For Linux, you might use `sudo apt-get install libsdl2-dev`, and for Windows, download the SDL2 development library.

**2. SDL2 Implementation (C)**

Here's a simplified yet functional SDL2-based snake game with image animation:

**snake_game_sdl.c**

```c
#include <SDL2/SDL.h>
#include <SDL2/SDL_image.h>
#include <stdio.h>
#include <stdlib.h>
#include <time.h>

#define WINDOW_WIDTH  800
#define WINDOW_HEIGHT 600
#define TILE_SIZE     20
#define SNAKE_SPEED  150  // in milliseconds

// Load images (assuming snake parts, food, and background are in PNG format)
SDL_Texture* load_texture(const char* path) {
    SDL_Texture* texture = IMG_LoadTexture(SDL_GetRenderer(SDL_InitSubsystem()), path);
    if (!texture) {
        SDL_Log("Could not load texture: %s", path);
        exit(1);
    }
    return texture;
}

// Main game loop
int main(int argc, char* argv[]) {
    SDL_Init(SDL_INIT_VIDEO);
    SDL_Window* window = SDL_CreateWindow("Snake Game", SDL_WINDOWPOS_CENTERED, SDL_WINDOWPOS_CENTERED, WINDOW_WIDTH, WINDOW_HEIGHT, SDL_WINDOW_SHOWN);
    SDL_Renderer* renderer = SDL_CreateRenderer(window, -1, SDL_RENDERER_ACCELERATED);
    SDL_SetRenderDrawColor(renderer, 0, 0, 0, 255);

    SDL_Texture* snake_texture = load_texture("snake_part.png");
    SDL_Texture* food_texture = load_texture("food.png");
    SDL_Texture* background_texture = load_texture("background.png");

    SDL_Rect snakePart, food, bg;
    snakePart.w = TILE_SIZE; snakePart.h = TILE_SIZE;
    food.w = TILE_SIZE; food.h = TILE_SIZE;
    bg.w = WINDOW_WIDTH; bg.h = WINDOW_HEIGHT;

    // Initialize snake and food positions
    int snakeX[100], snakeY[100], snakeLength = 5;
    snakeX[0] = WINDOW_WIDTH / 2; snakeY[0] = WINDOW_HEIGHT / 2;
    for (int i = 1; i < snakeLength; i++) {
        snakeX[i] = snakeX[i-1] - TILE_SIZE;
        snakeY[i] = snakeY[i-1];
    }
    food.x = (rand() % (WINDOW_WIDTH / TILE_SIZE - 1)) * TILE_SIZE;
    food.y = (rand() % (WINDOW_HEIGHT / TILE_SIZE - 1)) * TILE_SIZE;

    bool quit = false;
    SDL_Event e;
    int direction = 0;  // 0: right, 1: down, 2: left, 3: up

    clock_t prevTime = clock();

    while (!quit) {
        while (SDL_PollEvent(&e) != 0) {
            if (e.type == SDL_QUIT) quit = true;
            if (e.type == SDL_KEYDOWN) {
                switch (e.key.keysym.sym) {
                    case SDLK_UP: if (direction != 2) direction = 3; break;
                    case SDLK_DOWN: if (direction != 0) direction = 1; break;
                    case SDLK_LEFT: if (direction != 3) direction = 2; break;
                    case SDLK_RIGHT: if (direction != 1) direction = 0; break;
                }
            }
        }

        // Clear screen
        SDL_RenderClear(renderer);

        // Update snake position
        if ((clock() - prevTime) * 1000.0 / CLOCKS_PER_SEC >= SNAKE_SPEED) {
            prevTime = clock();
            switch (direction) {
                case 0: snakeX[0] += TILE_SIZE; break;
                case 1: snakeY[0] += TILE_SIZE; break;
                case 2: snakeX[0] -= TILE_SIZE; break;
                case 3: snakeY[0] -= TILE_SIZE; break;
            }

            // Move snake tail
            for (int i = snakeLength - 1; i > 0; i--) {
                snakeX[i] = snakeX[i-1];
                snakeY[i] = snakeY[i-1];
            }

            // Check for collision with food
            if (snakeX[0] == food.x && snakeY[0] == food.y) {
                snakeLength++;
                food.x = (rand() % (WINDOW_WIDTH / TILE_SIZE - 1)) * TILE_SIZE;
                food.y = (rand() % (WINDOW_HEIGHT / TILE_SIZE - 1)) * TILE_SIZE;
            }

            // Check for collision with walls or self
            if (snakeX[0] < 0 || snakeX[0] >= WINDOW_WIDTH || snakeY[0] < 0 || snakeY[0] >= WINDOW_HEIGHT ||
                snakeX[0] == snakeX[snakeLength-1] && snakeY[0] == snakeY[snakeLength-1]) {
                quit = true;
            }
        }

        // Render background
        SDL_RenderCopy(renderer, background_texture, NULL, &bg);

        // Render snake
        for (int i = 0; i < snakeLength; i++) {
            snakePart.x = snakeX[i];
            snakePart.y = snakeY[i];
            SDL_RenderCopy(renderer, snake_texture, NULL, &snakePart);
        }

        // Render food
        SDL_RenderCopy(renderer, food_texture, NULL, &food);

        SDL_RenderPresent(renderer);
    }

    SDL_DestroyRenderer(renderer);
    SDL_DestroyWindow(window);
    SDL_Quit();

    return 0;
}
```

**3. Additional Steps**

- **Image Preparation**: Ensure your images (`snake_part.png`, `food.png`, `background.png`) are in the same directory or adjust the paths accordingly.
- **Compile with SDL2**: Use a C compiler with SDL2 support, e.g., `gcc snake_game_sdl.c -o snake_game -lSDL2 -lSDL2_image`.
- **Run the Game**: Execute the compiled binary, e.g., `./snake_game`.

**4. Handling Smoothness**

- **Frame Rate Control**: Adjust `SNAKE_SPEED` to control the game's frame rate for smoothness.
- **Double Buffering**: While SDL2 handles this internally with `SDL_RENDERER_ACCELERATED`, ensure your renderer is set up correctly.

This example provides a solid foundation for a smooth snake game with image animation using SDL2 in C. If you prefer a pure C approach without SDL, you might need to delve deeper into custom double-buffering techniques, which can be more complex but feasible.

